import React, { useState, useEffect } from 'react';
import "bootstrap/dist/css/bootstrap.min.css";
import App from '../App';
import Button from 'react-bootstrap/Button';
import Row from 'react-bootstrap/Row';
import ProjectCard from './projectCard';
import Col from 'react-bootstrap/Col';

const URL = "http://localhost:5000/";
const projectsURL = URL + "projects/";

const Home = (params) => {

    useEffect(() => {
        console.log(params);
    }
        , []);

    return (
        <>
            <div>
                <h1>Welcome {params.user.username}</h1>
                <h4>Location: {params.user.location}</h4>
                    {params.user.projects?.length > 0 ? (
                        <Row xs={1} md={3} className="g-0 container">
                            {params.user.projects.map((project) => (
                                <Col key={project.id} className='mr-4'>
                                    <ProjectCard project={project} key={project.id} />
                                </Col>
                            ))}
                        </Row>
                    ) : (
                        <div className='empty'>
                            <h2>No projects found</h2>
                        </div>
                    )}
            </div>
        </>
    );
}

export default Home;
